# 话说AtCoder的黄题都这么水吗
这题真的是太水了……

在小学奥数里面这种题到处都是啊…… ~~上了初二都忘不掉~~

就是看看总数是不是4的倍数啊，是的话就后选（选 (4-另一个人的选的) ），对面选啥就选这么多，保证还剩4的倍数个，保证自己取最后的几个，并且让对方没法一次拿完

要不然就先选

代码

```cpp
#include<iostream>
using namespace std;
int main()
{
	int num; //252035059 < INT_MAX
	cin>>num;
	if(num%4==0)
	{
		cout<<"GO\n"; //题里说了要加换行！！！不加就爆0……
	}else
	{
		cout<<"SEN\n";
	}
	return 0;
}
```
蒟蒻的第一篇题解……

对本题进行分析，因为每个人可以取1,2或者3枚，所以两人总和最大可取4枚。所以对石头总数进行分析，如果对4取余，如果有余数，，只要先手将余数的石头取走，剩下的跟着对方取就行了，如果是四的整数倍，就后手取，满足两人每次取的总数为4即可。
```
#include<bits/stdc++.h>//万能库开头 
using namespace std;
int main()
{
	long long a;//定义石头数 
	cin>>a;//输入 
	if(a%4==0)//判断除以4的余数 
	{
		cout<<"GO"<<endl;//如果是4的整数倍输出GO
	}
	else
	{
		cout<<"SEN"<<endl;//否则输出SEN 
	}
	return 0;//结束 
}
```
